const initSate = {
    filters: {
        search :'',
        status : 'All',
        priority : []
    },
    todoList:[
        {
            id: '',
            courseName:'',
            completed: false,
            priority: 'Medium',

        }
    ]
}
 const rootReducer = (state= initSate, action) =>{
    switch(action.type){
        case 'todoList/addTodo':
            return {
                ...state,
                todoList: [
                    ...state.todoList,
                    
                ]
            }
            default: 
                return state;
    }
}
export default rootReducer
